function I = fcnK0E(S, T, u, alpha, F, tol)
t1 = 0.1e1 ./ alpha;t2 = S .* alpha;t3 = -t2 + u;t4 = 0.1e1 ./ t3;t5 = t4 .* t1;t6 = sqrt(-alpha);t7 = F - t6;t8 = 0.1e1 ./ t7;t9 = t7 .^ 2;t11 = t6 .* S;t12 = t7 .* t11;t15 = sqrt(t9 .* S + 0.2e1 .* t12 - t2 + u);t16 = 0.1e1 ./ t15;t20 = S .* t1;t21 = t3 .^ 2;t22 = 0.1e1 ./ t21;t23 = t22 .* t6;t27 = S .^ 2;t28 = t22 .* t27;t29 = 0.1e1 ./ u;t34 = sqrt(t3);t37 = 0.1e1 ./ t34 ./ t21 .* t6;t41 = log(0.2e1 .* t8 .* (t15 .* t34 + t12 - t2 + u));t45 = t29 .* t5;t50 = F + t6;t51 = 0.1e1 ./ t50;t52 = t50 .^ 2;t54 = t50 .* t11;t57 = sqrt(t52 .* S - t2 - 0.2e1 .* t54 + u);t58 = 0.1e1 ./ t57;t72 = log(0.2e1 .* t51 .* (t57 .* t34 - t2 - t54 + u));t81 = 0.1e1 ./ t6 .* t1;t86 = 0.1e1 ./ t34 ./ t3;t96 = t16 .* t8 .* t5 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t16 .* t23 .* t20 + 0.3e1 ./ 0.4e1 .* F .* t16 .* t29 .* t28 - 0.3e1 ./ 0.4e1 .* t41 .* t37 .* t20 + F .* S .* t16 .* t45 ./ 0.4e1 + t58 .* t51 .* t5 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t58 .* t23 .* t20 + 0.3e1 ./ 0.4e1 .* F .* t58 .* t29 .* t28 + 0.3e1 ./ 0.4e1 .* t72 .* t37 .* t20 + F .* S .* t58 .* t45 ./ 0.4e1 + t16 .* t4 .* t81 ./ 0.4e1 - t41 .* t86 .* t81 ./ 0.4e1 - t58 .* t4 .* t81 ./ 0.4e1 + t72 .* t86 .* t81 ./ 0.4e1;
I = t96(:,:,2) - t96(:,:,1);

end
